                                                                                                         "created datetime NOT NULL DEFAULT '0000-00-00 00:00:00',\n" +
                                                                                                         "updated datetime DEFAULT '0000-00-00 00:00:00',\n" +
                                                                                                         "PRIMARY KEY (ad_id),\n" +
                                                                                                         "KEY active (active)\n" +
                                                                                                         ")"));
        } catch (DatabaseException e) {
